import React, { Component } from 'react'

import {
  Button,
  Card,
  CardHeader,
  CardBody,
  FormGroup,
  Form,
  Input,
  InputGroupAddon,
  InputGroupText,
  InputGroup,
  Row,
  Col
} from "reactstrap";


import { error } from "jquery";
import { useState } from "react";
import {  useHistory} from 'react-router'
// import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

//  handleApi=()=> {
